import { Box, Typography } from '@mui/material'
import React from 'react'

const Text = () => {
  return (
    <Box >
        {/* main title */}
        <Typography variant='h2' component='div' fontWeight={600}>
        To each their home.
        </Typography>
        <Typography variant='h6' component='div'>
        Let’s find a home that’s perfect for you
        </Typography>
        {/* subtitle */}
    </Box>
  )
}

export default Text
